import react from 'react';
import './Header.css';
import data from '../../data.js'

const Header = () => {
    return(
        <div className="header">
            {data.map((item) => {
                <div className="stories">
                <h1>{item.title}</h1>
                </div>
            })}
        </div>
    )
}

export default Header;
